import React from 'react';

type MapProps = {
    location: string | null;
};

const Map: React.FC<MapProps> = ({ location }) => {
    // Render your map here, using the location prop
    return (
        <div>
            {/* Map placeholder */}
            <p>Map for: {location ?? 'No location selected'}</p>
        </div>
    );
};

export default Map;
